(1, 'FaSEs Web', 'Projeto desenvolvido por alunos do 4° ano de informática, afim de criar a plataforma para a Fábrica de Software Escola lorem loremloremlorem loremlorem lorem loremloremlorem loremlorem lorem loremloremlorem loremlorem lorem loremloremlorem loremlorem lorem loremlore', 1, , 'Projeto desenvolvido por alunos do 4° ano de informática, afim de criar a plataforma para a Fábrica de Software Escola', 'educacao, tecnologia', 'site, celular', 'Fábrica de software escola', 'estudantes, cidadãos de natal', 'Projeto em desenvolvimento por PDS', 'Não', 'html, css, javascript', 1, 0, 48, 0, 2);
INSERT INTO `projeto` (`idprojeto`, `nome`, `descricao`, `idequipe`, `logo`, `texto_inicial`, `categoria`, `plataforma`, `sobre`, `publico`, `motivo`, `vinculada`, `palavras_chaves`, `publicar`, `concluido`, `id_orientador`, `id_ideia`, `id_lider`) VALUES
(2, 'MUDIFast', 'O projeto MUDIFast, é uma solução dinâmica e efetiva no sentido de modernizar os processos comunicacionais internos utilizando diferentes estratégias de comunicação.\nO produto, inicialmente, tem como meta a difusão das portarias e demais informes organizados pelo Gabinete e a Gestão de Pessoas, sendo os mesmos os responsáveis pela realização de uploads constantemente dos documentos (portarias), bem como informes/notícias que seria disponibilizado pela Comunicação Social.', 2, , 'O projeto MUDIFast, é uma solução dinâmica e efetiva no sentido de modernizar os processos comunicacionais internos utilizando diferentes estratégias de comunicação.', 'tecnologia', 'site, celular', 'Difusão das portarias e demais informes organizados pelo IFRN - Zona Norte', 'Servidores do campus IFRN-ZN', 'Projeto em desenvolvimento por PDS', 'Não', 'portarias, html, css, javascript', 1, 0, 13, 0, 0);
INSERT INTO `projeto` (`idprojeto`, `nome`, `descricao`, `idequipe`, `logo`, `texto_inicial`, `categoria`, `plataforma`, `sobre`, `publico`, `motivo`, `vinculada`, `palavras_chaves`, `publicar`, `concluido`, `id_orientador`, `id_ideia`, `id_lider`) VALUES
(3, 'ACHA', 'O Assistente de Carga Horária Acadêmico (ACHA), é um software que recebe diversas interações específicas do(s) usuário(s) com o sistema, retornando, com base nessas interações, informações consistentes acerca da previsão dos acontecimentos futuros da instituição, no âmbito do quadro de professores.\r\nO sistema trabalha com dois níveis de permissão, cada um com funções diferentes, o Diretor Acadêmico (nível mais alto) e o Coordenador de Grupo (nível mais baixo). Devido a suas diferentes funções, no que compete ao sistema, cada um tem diferentes entradas a fazer e saídas recebidas.\r\nComeçando do nível mais baixo, o Coordenador de Grupo é o responsável pela distribuição dos professores por disciplina, cujo será atribuído (dentro do sistema) pelo papel do Diretor Acadêmico. Sua única saída é o quadro de professores do grupo o qual ele coordena e sua única interação com o sistema é a distribuição dos professores.\r\nJá o Diretor Acadêmico é responsável pelo planejamento como um todo, podendo, inclusive, realizar ou interferir nas funções do Coordenador de Grupo. Suas interações com o sistema são relativas aos cursos e turmas da instituição de ensino; ao pessoal relacionado à instituição, em especial o corpo docente; e a instituição em si. Nessas interações, o Diretor Acadêmico fornecerá dados reais, da situação atual da instituição (como as turmas existentes, os cursos oferecidos, os professores associados, etc), e dados fictícios, das situações previstas ou desejadas no futuro, associando-os e tendo, como resultado final, as possibilidades de ações futuras para o melhor planejamento de oferta de turmas futuras.', 3, , 'O Assistente de Carga Horária Acadêmico (ACHA), é um software que recebe diversas interações, retornando, com base nessas interações, informações consistentes acerca da previsão dos acontecimentos futuros da instituição, no âmbito do quadro de professores.', 'tecnologia', 'site, celular', 'Assistente de carga horária do IFRN - Zona Norte', 'Servidores do campus IFRN-ZN', 'Projeto em desenvolvimento por PDS', 'Não', 'horários, programação, sistema', 1, 0, 0, 0, 0);
INSERT INTO `projeto` (`idprojeto`, `nome`, `descricao`, `idequipe`, `logo`, `texto_inicial`, `categoria`, `plataforma`, `sobre`, `publico`, `motivo`, `vinculada`, `palavras_chaves`, `publicar`, `concluido`, `id_orientador`, `id_ideia`, `id_lider`) VALUES
(4, 'SIGMIN', 'O Sistema Gerenciado de Minicurso é uma alternativa para a realização das inscrições nos minicursos oferecidos pelo curso de Licenciatura em Informática, que vai facilitar, padronizar e melhorar esse processo que atualmente é feito de forma manual.', 4, , 'O Sistema Gerenciado de Minicurso é uma alternativa para a realização das inscrições nos minicursos oferecidos pelo curso de Licenciatura em Informática, que vai facilitar, padronizar e melhorar esse processo que atualmente é feito de forma manual.', 'educacao, tecnologia, social', 'site, celular', 'Sistema gerenciador de minicursos', 'estudantes, Servidores do campus IFRN-ZN', 'Projeto em desenvolvimento por PDS', 'Não', 'minicurso, sistema', 1, 0, 0, 0, 0),
(14, 'binChallenger', 'O binChallenge é um jogo prático e dinâmico que tem como objetivo criar um meio de se aprender sobre o sistema binário de uma forma interessante e divertida, resultando em um nível de interesse maior sobre o assunto.', NULL, , 'O binChallenge é um jogo prático e dinâmico que tem como objetivo criar um meio de se aprender sobre o sistema binário de uma forma interessante e divertida, resultando em um nível de interesse maior sobre o assunto.', 'educacao, social', 'site, celular', 'Jogo de binários', 'estudantes, criancas', 'Projeto em desenvolvimento por PDS', 'Não', 'binário, programação, site', 1, 0, 0, 0, 0);
INSERT INTO `projeto` (`idprojeto`, `nome`, `descricao`, `idequipe`, `logo`, `texto_inicial`, `categoria`, `plataforma`, `sobre`, `publico`, `motivo`, `vinculada`, `palavras_chaves`, `publicar`, `concluido`, `id_orientador`, `id_ideia`, `id_lider`) VALUES
(15, 'COLINFO', 'É um repositório digital que armazenará trabalhos científicos do IFRN para a preservação e divulgação, possibilitando o crescimento das atividades científicas da instituição. Sendo destinado aos alunos e professores do curso de informática.', NULL, , 'É um repositório digital que armazenará trabalhos científicos do IFRN para a preservação e divulgação, possibilitando o crescimento das atividades científicas da instituição. Sendo destinado aos alunos e professores do curso de informática.', 'educacao, tecnologia', 'site, celular', 'Coleção de trabalhos acadêmicos de informática', 'estudantes, Servidores do campus IFRN-ZN', 'Projeto em desenvolvimento por PDS', 'Não', 'tecnologia, repositório', 1, 0, 0, 0, 0);
